import React from 'react';
import '../styles/Experience.css'; // Create a CSS file for styling

export default function Experience() {
  const projects = [
    { title: 'Project 1', description: 'A brief description of project 1.', link: '#' },
    { title: 'Project 2', description: 'A brief description of project 2.', link: '#' },
    { title: 'Project 3', description: 'A brief description of project 3.', link: '#' },
    { title: 'Project 4', description: 'A brief description of project 4.', link: '#' },
    { title: 'Project 5', description: 'A brief description of project 5.', link: '#' },
    { title: 'Project 6', description: 'A brief description of project 6.', link: '#' }
  ];

  return (
    <div className="experience-container">
      <h1 className="experience-heading">My Projects</h1>
      <div className="bento-grid">
        {projects.map((project, index) => (
          <div key={index} className="bento-box">
            <h2 className="project-title">{project.title}</h2>
            <p className="project-description">{project.description}</p>
            <a href={project.link} className="project-link">View Project</a>
          </div>
        ))}
      </div>
    </div>
  );
}
